CREATE PROCEDURE dbo.proc_transform_318
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_318
    SET payload = LEFT(payload, 1000) + N'|V4-318|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_318;
END
